import React, { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css'; // Import styles for the date picker
import './Input.css';

// You can import an icon from a library, e.g., Font Awesome
import { FaCalendarAlt } from 'react-icons/fa'; // Example icon

const Input = ({ message, setMessage, sendMessage }) => {
    const [scheduleDate, setScheduleDate] = useState(null); // State to hold the selected date
    const [datePickerOpen, setDatePickerOpen] = useState(false); // State to control date picker visibility

    const handleSubmit = (event) => {
        event.preventDefault();
        if (scheduleDate) {
            const scheduledTime = scheduleDate.getTime();
            sendMessage(event, scheduledTime); // Pass scheduled time to sendMessage
        } else {
            sendMessage(event); // Send message immediately if no date is set
        }
        // Reset the date picker after sending
        setScheduleDate(null);
    };

    return (
        <form className='form' onSubmit={handleSubmit}>
            <input
                className='input'
                type='text'
                placeholder="Type a message..."
                value={message}
                onChange={(event) => setMessage(event.target.value)}
                onKeyDown={event => event.key === 'Enter' ? handleSubmit(event) : null}
            />
            <button className='sendButton' type='submit'>Send</button>
            
            {/* Date Picker with Calendar Icon */}
            <div className='datePickerContainer'>
                <FaCalendarAlt 
                    className='dateIcon' 
                    onClick={() => setDatePickerOpen(!datePickerOpen)} // Toggle date picker on icon click
                /> {/* Calendar icon */}
                {datePickerOpen && (
                    <DatePicker
                        selected={scheduleDate}
                        onChange={date => {
                            setScheduleDate(date);
                            setDatePickerOpen(false); // Close date picker after selection
                        }}
                        showTimeSelect
                        dateFormat="Pp"
                        placeholderText="Schedule Time"
                        className='datePicker'
                        onCalendarClose={() => setDatePickerOpen(false)} // Close calendar when clicked outside
                    />
                )}
            </div>
        </form>
    );
};

export default Input;
